import React from "react";

function Login (){
    return(
        <div>
        <form>
        <div>
            <h1>Login</h1>
            <input type="text" placeholder="Username"/>    
            <input type="password" placeholder="Password"/>        
            <button type="submit">Submit</button>
            </div>
             </form>
        </div>
    )
}


export default Login;
